#!/usr/bin/env python3

import sys

def shortDNA(dna,length):
	dnaInput = dna.strip()
	newdna = ""
	count = 0
	for i in dnaInput:
		if i == '\n':
			continue
		newdna = newdna+i
		if count < (length-1):
			count = count + 1
		
		elif count == (length-1):
			newdna = newdna + '\n'
			count = 0
	print(newdna)


